import React from 'react';
import { Container } from 'react-bootstrap';
import './Blogs.css';

const Blogs = () => {
    return (
        <div className="blog-section">
            <Container>
                <div className="text-center">
                    <h2 className="title">Blogs</h2>
                </div>
            </Container>
        </div>
    );
};

export default Blogs;
